import React from 'react';
import '../styles/pages/HomeStyle.css';
import Navbar from "../components/Navbar";

function HomePage() {
    // Function to get the token from the global variable
    const getToken = () => {
        // Check if the token exists in the global variable
        if (window.authToken) {
            return (
                <div className="token-container">
                    <h2>Your Token:</h2>
                    <p>{window.authToken}</p>
                </div>
            );
        } else {
            return (
                <div className="token-container">
                    <p>No token available.</p>
                </div>
            );
        }
    };

    return (
        <div className="home-container">
            <Navbar/>

            <header className="header">
                <h1>Welcome to My Website</h1>
                <p>Discover amazing content and more.</p>
            </header>

            {/* Call the getToken function to display the token */}
            {getToken()}
        </div>
    );
}

export default HomePage;
